import React from 'react';
import { TextField, MenuItem, Button, Checkbox, FormControlLabel } from '@mui/material';

const Filters = ({ filters, setFilters, onApplyFilters }) => {
  const handleFilterChange = (name, value) => {
    setFilters((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px' }}>
      {/* Date Range Filters */}
      <TextField
        label="Start Date"
        type="date"
        value={filters.start_date || ''}
        onChange={(e) => handleFilterChange('start_date', e.target.value)}
        InputLabelProps={{ shrink: true }}
      />
      <TextField
        label="End Date"
        type="date"
        value={filters.end_date || ''}
        onChange={(e) => handleFilterChange('end_date', e.target.value)}
        InputLabelProps={{ shrink: true }}
      />

      {/* Amount Range Filters */}
      <TextField
        label="Min Amount"
        type="number"
        value={filters.min_amount || ''}
        onChange={(e) => handleFilterChange('min_amount', e.target.value)}
      />
      <TextField
        label="Max Amount"
        type="number"
        value={filters.max_amount || ''}
        onChange={(e) => handleFilterChange('max_amount', e.target.value)}
      />

      {/* Pay Type Filter */}
      <TextField
        select
        label="Pay Type"
        value={filters.paytype_id || ''}
        onChange={(e) => handleFilterChange('paytype_id', e.target.value)}
      >
        <MenuItem value="1">Cash</MenuItem>
        <MenuItem value="2">Check</MenuItem>
        <MenuItem value="3">Visa</MenuItem>
        {/* Add more options as needed */}
      </TextField>

      {/* Provider Filter */}
      <TextField
        label="Provider"
        value={filters.provider_id || ''}
        onChange={(e) => handleFilterChange('provider_id', e.target.value)}
      />

      {/* Employee Type Filter */}
      <TextField
        label="Employee Type"
        value={filters.employee_type_id || ''}
        onChange={(e) => handleFilterChange('employee_type_id', e.target.value)}
      />

      {/* Day of the Week Filter */}
      <TextField
        select
        label="Day of the Week"
        value={filters.day_of_week || ''}
        onChange={(e) => handleFilterChange('day_of_week', e.target.value)}
      >
        <MenuItem value="monday">Monday</MenuItem>
        <MenuItem value="tuesday">Tuesday</MenuItem>
        <MenuItem value="wednesday">Wednesday</MenuItem>
        <MenuItem value="thursday">Thursday</MenuItem>
        <MenuItem value="friday">Friday</MenuItem>
        <MenuItem value="saturday">Saturday</MenuItem>
        <MenuItem value="sunday">Sunday</MenuItem>
      </TextField>

      {/* Exclude Non-Positive Amounts */}
      <FormControlLabel
        control={
          <Checkbox
            checked={filters.exclude_non_positive || false}
            onChange={(e) => handleFilterChange('exclude_non_positive', e.target.checked)}
          />
        }
        label="Exclude Non-Positive Amounts"
      />

      {/* Apply Filters */}
      <Button variant="contained" onClick={onApplyFilters}>
        Apply Filters
      </Button>
    </div>
  );
};

export default Filters;
